const oldHeading = `<div class="mw-h2section"><div class="mw-heading mw-heading2"><h2 id="Get_in">Get in</h2><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=3" title="Edit section's source code: Get in"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></div><div class="mw-h3section"><div class="mw-heading mw-heading3"><h3 id="By_plane">By plane</h3><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=4" title="Edit section's source code: By plane"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></div><style data-mw-deduplicate="TemplateStyles:r4851880">.mw-parser-output .pp_infobox{color:#333;background-color:#effafa;font-size:90%;border:1px solid #ccc;padding-left:1em;padding-right:1em;text-align:left;width:100%}html.skin-theme-clientpref-night .mw-parser-output .pp_infobox td{color:inherit!important;background-color:inherit!important}@media(prefers-color-scheme:dark){html.skin-theme-clientpref-os .mw-parser-output .pp_infobox td{color:inherit!important;background-color:inherit!important}}</style><table class="pp_infobox infobox" style="float:right; clear:right; margin-left: 1em; width:40%;" cellpadding="8" cellspacing="1">
<tbody><tr>
<td>
<p><strong>Oakland or Auckland?</strong>
</p><p>It's not just <i>Full House'</i>s Stephanie and Michelle Tanner that have ended up in <a href="/wiki/Auckland" title="Auckland">Auckland</a>, <a href="/wiki/New_Zealand" title="New Zealand">New Zealand</a> instead of Oakland, California. Several incidents have been reported of tourists destined for Oakland ending up on the wrong side of the Pacific, either due to ticketing agent errors, or because they misheard an Air New Zealand flight attendant saying their London to Los Angeles flight was continuing to "Oakland". It may pay to double check your airline tickets and the destination screens before you board your flight; otherwise, it will be an expensive flight home.
</p>
</td></tr></tbody></table><ul><li><bdi class="vcard"><span id="Q1165584"></span><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.71243</abbr><abbr class="longitude">-122.21317</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/0" data-zoom="17" data-lat="37.71243" data-lon="-122.21317" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">1</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="http://www.oaklandairport.com/" target="_blank"><span id="San_Francisco_Bay_Oakland_International_Airport" class="fn org listing-name" style="font-weight:bold;">San Francisco Bay Oakland International Airport</span></a><span id="Q1165584"></span> (<bdi class="nickname listing-alt" style="font-style: italic;"><b>OAK </b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup></bdi>) (<bdi class="listing-directions" style="font-style: italic;">Airport Rd off of Doolittle (SR-61); from Nimitz Freeway (I-880) the airport can be accessed from 98th Ave (Exit #36) or Hegenberger Rd (becomes Airport Rd) (Exit #35)</bdi>). <bdi class="note listing-content">It is served by many domestic and international carriers. Domestic non-stop air service is available from <a href="/wiki/Southern_California#By_plane" title="Southern California">Southern California</a>, Hawaii, most other cities on the West Coast, and a few flights to the East Coast. There are international flights from the Azores, El Salvador and Mexico. The main carriers that serve OAK are <a rel="nofollow noopener noreferrer" class="external text" href="https://www.spirit.com/en/flights-from-oakland" target="_blank">Spirit</a> and <a rel="nofollow noopener noreferrer" class="external text" href="https://www.southwest.com/origins/west/oakland" target="_blank">Southwest Airlines</a>:</bdi></bdi></li></ul><dl><dd><ul><li>Terminal 1 (Gates 1-17):Alaska, Allegiant, Avianca El Salvador, Azores, Contour (from <a href="/wiki/Crescent_City" title="Crescent City">Crescent City</a>); Delta, Hawaiian, Southwest, Spirit, Viva Aerobus, Volaris, Volaris El Salvador</li>
<li>Terminal 2 (Gates 20-32): Southwest.</li>
<li><a rel="nofollow noopener noreferrer" class="external text" href="https://www.jsx.com/destinations/oak" target="_blank">JSX</a> have their own separate terminal at 9351 Earhart Rd at the North Field (General Aviation/VIP Airport).<br></li></ul></dd></dl><p>There is private shuttle service ($10–25) to hotels in Oakland and San Francisco. The airport is also served by the "BART to OAK" people mover to the Oakland Coliseum BART Station, from where you can continue onward to central Oakland or San Francisco, or transfer to the similarly named Amtrak Capitol Corridor station. The people mover runs every 5 minutes during the day, and ticket pricing is integrated, e.g. $7.85 to central Oakland or $10.05 to central San Francisco. This replaces the earlier <i>AirBART</i> buses, which have now been retired. The ariport terminals are also served by <span class="vcard"> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.actransit.org/maps-schedules" target="_blank"><span id="AC_Transit" class="fn org listing-name" style="font-weight:bold;">AC Transit</span></a></span> routes #21, 73 and 805 while the nearby Coliseum BART Station is served by AC Transit #45, 46L, 73, 90, 98 and 805 buses.<span class="listing-sister-icons"> <span class="listing-sister" typeof="mw:File"><a href="https://www.wikidata.org/wiki/Q1165584" title="San Francisco Bay Oakland International Airport (Q1165584) on Wikidata" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="San Francisco Bay Oakland International Airport (Q1165584) on Wikidata" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/16px-Wikidata-logo.svg.png" decoding="async" width="16" height="9" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/24px-Wikidata-logo.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/32px-Wikidata-logo.svg.png 2x" data-file-width="1050" data-file-height="590"></a></span> <span class="listing-sister" typeof="mw:File"><a href="https://en.wikipedia.org/wiki/San_Francisco_Bay_Oakland_International_Airport" title="San Francisco Bay Oakland International Airport on Wikipedia" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="San Francisco Bay Oakland International Airport on Wikipedia" src="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/16px-Antu_wikipedia.svg.png" decoding="async" width="16" height="16" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/24px-Antu_wikipedia.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/32px-Antu_wikipedia.svg.png 2x" data-file-width="512" data-file-height="512"></a></span></span><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Apr 2020</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span>
</p><p>Other air travel options include the <b><a href="/wiki/San_Francisco_International_Airport" title="San Francisco International Airport">San Francisco</a></b> (<b><a href="/wiki/San_Francisco_International_Airport#By_plane" title="San Francisco International Airport">SFO</a></b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup>) and <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.flysanjose.com/" target="_blank">San Jose</a></b> (<b><a href="/wiki/San_Jose_(California)#By_plane" title="San Jose (California)">SJC</a></b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup>) International Airports which are connected by <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov" target="_blank">BART</a></b> and <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.caltrain.com" target="_blank">CalTrain</a></b>  if transferring by public transportation:
</p><dl><dd><ul><li><a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/cols" target="_blank">Coliseum Station</a> to <a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/sfia" target="_blank">Balboa Park Station</a> on the 'Blue' or 'Green' Line trains going towards Daly City. Transfer from the 'Blue' or 'Green' Line trains in Balboa Park Station to the 'Red' or 'Yellow' Line trains going towards SFO Airport/Millbrae Transit Center and get off at the '<a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/sfia" target="_blank">SFO Airport Station</a>' at the International Terminal</li>
<li>Downtown San Francisco is accessed through Embacardero, Montgomery St, Powell St, UN/Civic Plaza or Van Ness Stations. For going to downtown Oakland, take the northbound Orange Line train, going towards Richmond, and get off at either 12th St, 19th St, or MacArthur Stations.</li>
<li>For going towards San Jose Mineta International Airport stay on the 'Red' or 'Yellow' Line trains from SFO to the end of the line in Millbrae and transfer to the southbound <a rel="nofollow noopener noreferrer" class="external text" href="https://www.caltrain.com/stations-zones" target="_blank">Caltrain</a> (going towards San Jose or Gilroy) to the Santa Clara Caltrain Station. Transfer to <a rel="nofollow noopener noreferrer" class="external text" href="https://www.vta.org/go/routes/60" target="_blank">VTA #60</a> bus going towards Milpitas BART from the Santa Clara Caltrain Station, which goes by the airport terminals.</li>
<li>One can also take the southbound 'Green' or 'Orange' Line trains from the (Oakland) Coliseum Station, going towards Berryessa/North San Jose, and get off at the <a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/mlpt" target="_blank">Milpitas Station</a>. Transfer to the VTA #60 bus going towards 'Winchester Station via SJC Airport' from Milpitas to get to SJC airport.</li>
<li>Take <b><a rel="nofollow noopener noreferrer" class="external text" href="https://groometransportation.com/sonoma-county/sfo-oak/" target="_blank">Groome Transportation</a></b> bus or van from Oakland to Marin and Sonoma Counties up north and from San Jose (SJC) for going to Monterey Bay in the south.</li></ul></dd></dl><p>For private pilots, <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.oaklandairport.com/general-aviation/" target="_blank">Oakland General Aviation Airport</a></b> (<b>OAK </b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup>) has a separate General Aviation area "North Field", essentially the equivalent of another airport to the north of the commercial facilities, with separate tower, taxiways, and radio frequencies. Its long runway is frequently used for jet travel, and Oakland makes a far better GA destination than SFO's complex, heavily trafficked field.
</p></div><div class="mw-h3section"><div class="mw-heading mw-heading3"><h3 id="By_train">By train</h3><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=5" title="Edit section's source code: By train"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></div><dl><dd><i>See also: <a href="/wiki/Rail_travel_in_the_United_States" title="Rail travel in the United States">Rail travel in the United States</a></i></dd></dl><ul><li><bdi class="vcard"><span id="Q3095811"></span><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.7938</abbr><abbr class="longitude">-122.2715</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/1" data-zoom="17" data-lat="37.7938" data-lon="-122.2715" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">2</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/stations/okj" target="_blank"><span id="Jack_London_Square_station" class="fn org listing-name" style="font-weight:bold;">Jack London Square station</span></a><span id="Q3095811"></span>, <bdi class="adr listing-address street-address">245 Second Street</bdi>. <bdi class="note listing-content">It's always a good idea to get to your train at least 30 minutes early, to allow for lines, security and so forth.</bdi><span class="listing-sister-icons"> <span class="listing-sister" typeof="mw:File"><a href="https://www.wikidata.org/wiki/Q3095811" title="Oakland–Jack London Square station (Q3095811) on Wikidata" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Oakland–Jack London Square station (Q3095811) on Wikidata" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/16px-Wikidata-logo.svg.png" decoding="async" width="16" height="9" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/24px-Wikidata-logo.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/32px-Wikidata-logo.svg.png 2x" data-file-width="1050" data-file-height="590"></a></span> <span class="listing-sister" typeof="mw:File"><a href="https://en.wikipedia.org/wiki/Oakland%E2%80%93Jack_London_Square_station" title="Oakland–Jack London Square station on Wikipedia" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Oakland–Jack London Square station on Wikipedia" src="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/16px-Antu_wikipedia.svg.png" decoding="async" width="16" height="16" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/24px-Antu_wikipedia.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/32px-Antu_wikipedia.svg.png 2x" data-file-width="512" data-file-height="512"></a></span></span><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Oct 2023</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi>
<ul><li><bdi class="vcard"><span id="Q23239"></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/" target="_blank"><span id="Amtrak" class="fn org listing-name" style="font-weight:bold;">Amtrak</span></a><span id="Q23239"></span>, <abbr title="phone" style="text-decoration:none">☏</abbr> <bdi class="tel listing-phone"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1215-856-7924" target="_blank">+1 215-856-7924</a></span></bdi>, toll-free: <bdi class="tel listing-tollfree"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1-800-872-7245" target="_blank">+1-800-872-7245</a></span></bdi>. <bdi class="note listing-content">Operates train service around the <a href="/wiki/United_States_of_America" title="United States of America">United States of America</a>.</bdi><span class="listing-sister-icons"> <span class="listing-sister" typeof="mw:File"><a href="https://www.wikidata.org/wiki/Q23239" title="Amtrak (Q23239) on Wikidata" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Amtrak (Q23239) on Wikidata" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/16px-Wikidata-logo.svg.png" decoding="async" width="16" height="9" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/24px-Wikidata-logo.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/32px-Wikidata-logo.svg.png 2x" data-file-width="1050" data-file-height="590"></a></span> <span class="listing-sister" typeof="mw:File"><a href="https://en.wikipedia.org/wiki/Amtrak" title="Amtrak on Wikipedia" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Amtrak on Wikipedia" src="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/16px-Antu_wikipedia.svg.png" decoding="async" width="16" height="16" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/24px-Antu_wikipedia.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/32px-Antu_wikipedia.svg.png 2x" data-file-width="512" data-file-height="512"></a></span></span><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Mar 2022</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi> Routes stopping in Oakland:
<ul><li><b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/coast-starlight-train" target="_blank">Coast Starlight</a></b> operates daily between <a href="/wiki/Seattle" title="Seattle">Seattle</a> and <a href="/wiki/Los_Angeles" title="Los Angeles">Los Angeles</a>. Stops include <a href="/wiki/Tacoma" title="Tacoma">Tacoma</a>, <a href="/wiki/Lacey" title="Lacey">Lacey</a>, <a href="/wiki/Centralia_(Washington)" title="Centralia (Washington)">Centralia</a>, <a href="/wiki/Kelso_(Washington)" title="Kelso (Washington)">Kelso</a>, <a href="/wiki/Vancouver_(Washington)" title="Vancouver (Washington)">Vancouver, WA</a>, <a href="/wiki/Portland_(Oregon)" title="Portland (Oregon)">Portland,</a> <a href="/wiki/Salem_(Oregon)" title="Salem (Oregon)">Salem</a>, <a href="/wiki/Albany_(Oregon)" title="Albany (Oregon)">Albany</a>, <a href="/wiki/Eugene" title="Eugene">Eugene</a>, <a href="/wiki/Klamath_Falls" title="Klamath Falls">Klamath Falls</a>, <a href="/wiki/Dunsmuir" title="Dunsmuir">Dunsmuir</a>, <a href="/wiki/Redding" title="Redding">Redding</a>, <a href="/wiki/Chico_(California)" title="Chico (California)">Chico</a>, <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a>, <a href="/wiki/Davis_(California)" title="Davis (California)">Davis</a>, <a href="/wiki/Martinez_(California)" title="Martinez (California)">Martinez</a>, San Francisco (<a href="/wiki/Emeryville" title="Emeryville">Emeryville</a>), Oakland, <a href="/wiki/San_Jose_(California)" title="San Jose (California)">San Jose</a>, <a href="/wiki/Salinas" title="Salinas">Salinas</a>, <a href="/wiki/Paso_Robles" title="Paso Robles">Paso Robles</a>, <a href="/wiki/San_Luis_Obispo" title="San Luis Obispo">San Luis Obispo</a>, <a href="/wiki/Santa_Barbara" title="Santa Barbara">Santa Barbara</a>, <a href="/wiki/Oxnard" title="Oxnard">Oxnard</a>, <a href="/wiki/Simi_Valley" title="Simi Valley">Simi Valley</a>, <a href="/wiki/Van_Nuys" title="Van Nuys">Van Nuys</a>, and <a href="/wiki/Burbank" title="Burbank">Burbank</a>.</li>
<li><b><a rel="nofollow noopener noreferrer" class="external text" href="http://capitolcorridor.org/" target="_blank">Capitol Corridor</a></b> <a href="/wiki/San_Jose_(California)" title="San Jose (California)">San Jose</a> to <a href="/wiki/Auburn_(California)" title="Auburn (California)">Auburn</a> via <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a>). The route also includes a stop at the Oakland Coliseum/Airport Amtrak station. adjacent to the Oakland Coliseum BART station. The Oakland Coliseum/Airport Amtrak station has no station agents. Passengers may board the train and buy the tickets from the conductor at no surcharge.</li>
<li><b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/routes/san-joaquins-train.html" target="_blank">San Joaquins</a></b> (Oakland to <a href="/wiki/Bakersfield" title="Bakersfield">Bakersfield, California</a>)<figure class="mw-default-size" typeof="mw:File/Thumb"><a href="/wiki/File:Jack_London_Square_station_panorama,_October_2018.jpg" class="mw-file-description"><img src="//upload.wikimedia.org/wikipedia/commons/thumb/9/95/Jack_London_Square_station_panorama%2C_October_2018.jpg/220px-Jack_London_Square_station_panorama%2C_October_2018.jpg" decoding="async" width="220" height="95" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/95/Jack_London_Square_station_panorama%2C_October_2018.jpg/330px-Jack_London_Square_station_panorama%2C_October_2018.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/95/Jack_London_Square_station_panorama%2C_October_2018.jpg/440px-Jack_London_Square_station_panorama%2C_October_2018.jpg 2x" data-file-width="5281" data-file-height="2284"></a><figcaption>Jack London Square station</figcaption></figure></li></ul></li></ul></li></ul><ul><li>Adjacent to the northwest of Oakland in <a href="/wiki/Emeryville#By_train" title="Emeryville">Emeryville</a>, is Amtrak's area hub station with more train route options.</li>
<li>Connections to the <b><a rel="nofollow noopener noreferrer" class="external text" href="http://www.amtrak.com/pacific-surfliner-train" target="_blank">Pacific Surfliner</a></b> are in San Luis Obispo and Santa Barbara, are available with <b>Amtrak Thruway Motorcoaches</b> (see By bus below).</li></ul></div><div class="mw-h3section"><div class="mw-heading mw-heading3"><h3 id="By_car">By car</h3><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=6" title="Edit section's source code: By car"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></div><p>From San Francisco, Interstate 80 east leads over the beautiful <b>Bay Bridge</b> to I-580, I-880, and I-980, which go to east, west, and downtown Oakland respectively.
</p><p>From <a href="/wiki/Marin_County" title="Marin County">Marin</a>, <a href="/wiki/Sonoma_County" title="Sonoma County">Sonoma</a>, and other counties along the northern coast of California, take US-101 to I-580 and cross the Richmond Bridge. I-580 leads directly into Oakland.
</p><p>From <a href="/wiki/Monterey_(California)" title="Monterey (California)">Monterey</a>, <a href="/wiki/Salinas" title="Salinas">Salinas</a>, and the <a href="/wiki/Central_Coast_(California)" title="Central Coast (California)">Central Coast</a>, follow US-101 to San Jose and connect to I-880, which leads to Oakland.
</p><p>From <a href="/wiki/Tracy" title="Tracy">Tracy</a>, <a href="/wiki/Modesto" title="Modesto">Modesto</a>, and <a href="/wiki/San_Joaquin_Valley" title="San Joaquin Valley">San Joaquin Valley</a>'s southern portion (<a href="/wiki/Southern_California" title="Southern California">Southern California</a>, too), take the scenic I-580 over Altamont Pass.
</p><p>From <a href="/wiki/Stockton_(California)" title="Stockton (California)">Stockton</a>, either follow the Altamont Pass route or take California Route 4 through Contra Costa County to Route 242, then to Route I-680, which connects to Route 24.
</p><p>From the <a href="/wiki/Outer_East_Bay" title="Outer East Bay">outer East Bay</a>, Route 24 leads to north Oakland through the <b>Caldecott Tunnel</b>.
</p><p>From the northern <a href="/wiki/East_Bay_(Bay_Area)" class="mw-redirect" title="East Bay (Bay Area)">East Bay</a>, <a href="/wiki/Vallejo" title="Vallejo">Vallejo</a>, <a href="/wiki/Fairfield_(California)" title="Fairfield (California)">Fairfield</a>, and the greater <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a>, I-80 west leads directly to Oakland.
</p><p>Alternatively, you can connect to Highway 123 and <b>San Pablo Avenue</b> in <a href="/wiki/Richmond_(California)" title="Richmond (California)">Richmond</a>, and follow it to Oakland, if there is trouble on the parallel I-80. It's city streets, so will likely take extra time, and it will mean driving into and through everything between Richmond and West Oakland, including both <a href="/wiki/El_Cerrito" title="El Cerrito">El Cerrito</a> and <a href="/wiki/Berkeley" title="Berkeley">Berkeley</a>.
</p><p>Most northern entries to Oakland go through the heinous <b>MacArthur Maze</b>, a spaghetti-like mashup of four freeways trying to merge and pass each other. It's got terrible traffic during commute times (7AM-10AM, 4PM-8PM), so you might want to avoid driving on the freeways at these times.
</p></div><div class="mw-h3section"><div class="mw-heading mw-heading3"><h3 id="By_bus">By bus</h3><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=7" title="Edit section's source code: By bus"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></div><p>The <span class="vcard"><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.80487</abbr><abbr class="longitude">-122.2952</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/2" data-zoom="17" data-lat="37.80487" data-lon="-122.2952" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">3</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/woak" target="_blank"><span id="West_Oakland_BART_Station" class="fn org listing-name" style="font-weight:bold;">West Oakland BART Station</span></a></span> is also the bus stop location for the following intercity bus lines in Oakland:
</p><ul><li><bdi class="vcard"> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.flixbus.com/bus/oakland-berkeley-east-bay-ca" target="_blank"><span id="Flixbus" class="fn org listing-name" style="font-weight:bold;">Flixbus</span></a>, <bdi class="adr listing-address street-address">1431 7th St</bdi> (<bdi class="listing-directions" style="font-style: italic;">Near W. Oakland BART Station. Bus will board on 7th Street, in front of the public rental bike racks, located at the curbside with the sign, “No Stop. Bus Only."</bdi>), <abbr title="phone" style="text-decoration:none">☏</abbr> <bdi class="tel listing-phone"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1855626-8585" target="_blank">+1 855 626-8585</a></span></bdi>. <bdi class="note listing-hours">Daily 5:30AM-1:30AM</bdi>. <bdi class="note listing-content">They operate from <a href="/wiki/San_Francisco" title="San Francisco">San Francisco</a> to <a href="/wiki/Reno" title="Reno">Reno</a>, <a href="/wiki/Los_Angeles" title="Los Angeles">Los Angeles</a>, <a href="/wiki/Fresno" title="Fresno">Fresno</a>, <a href="/wiki/Bakersfield" title="Bakersfield">Bakersfield</a>, <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a> and <a href="/wiki/San_Jose_(California)" title="San Jose (California)">San Jose</a>. They also have additional stops at the Crescent Lawn at the UC Berkeley campus, El Cerrito del Norte BART, Hayward BART and Richmond BART. Check tickets and schedules as to where your bus pick up at.</bdi><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Oct 2022</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi></li>
<li><bdi class="vcard"><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.80524</abbr><abbr class="longitude">-122.29481</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/3" data-zoom="17" data-lat="37.80524" data-lon="-122.29481" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">4</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.greyhound.com/en-us/bus-station-892540" target="_blank"><span id="Greyhound" class="fn org listing-name" style="font-weight:bold;">Greyhound</span></a>, <bdi class="adr listing-address street-address">(bus stop) West Oakland BART Station @ 1451 7th St</bdi>, <abbr title="phone" style="text-decoration:none">☏</abbr> <bdi class="tel listing-phone"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1510832-4730" target="_blank">+1 510 832-4730</a></span></bdi>. <bdi class="note listing-content">Bus to Sacramento, Arcata, Los Angeles, San Joaquin Valley, etc.</bdi><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Oct 2022</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi></li>
<li><bdi class="vcard"><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.80501</abbr><abbr class="longitude">-122.2942</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/4" data-zoom="17" data-lat="37.80501" data-lon="-122.2942" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">5</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://us.megabus.com/" target="_blank"><span id="Megabus" class="fn org listing-name" style="font-weight:bold;">Megabus</span></a>, <bdi class="adr listing-address street-address">(bus stop) West Oakland BART Station @ 1451 7th St</bdi> (<bdi class="listing-directions" style="font-style: italic;">SAme location as Greyhound and Flix bus</bdi>). <bdi class="note listing-content">Goes over to Sacramento on one route and down to Los Angeles via Fresno, Bakersfield, Burbank on another.</bdi><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Sep 2023</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi></li>
<li><b>Amtrak Thruway Motorcoaches</b> connects Amtrak trains in Emeryville and Oakland Jack London Stations with downtown San Francisco, Santa Barbara and San Luis Obispo by bus.</li></ul><p>This BART station is also the bus transit center for <span class="vcard"> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.actransit.org/maps-schedules" target="_blank"><span id="ACTransit" class="fn org listing-name" style="font-weight:bold;">ACTransit</span></a></span> routes #29, 36, 62 and 800. The 800 only stops at the corner of 7th and Mandela Pkwy.
</p></div><div class="mw-h3section"><div class="mw-heading mw-heading3"><h3 id="By_ferry">By ferry</h3><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=8" title="Edit section's source code: By ferry"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></div><p>The <b><a rel="nofollow noopener noreferrer" class="external text" href="http://www.sanfranciscobayferry.com" target="_blank">San Francisco Bay Ferry</a></b> has departures from both Pier 41 and the Ferry Building in San Francisco. Its Oakland terminal is at the foot of Clay St. in Jack London Square, a block from the AC Transit stop and easy walking distance to the Amtrak Station.
</p></div></div>`;
const newHeading =  `<div class="mw-h2section"><h2><span class="mw-headline" id="Get_in">Get in</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=3" title="Edit section's source code: Get in"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></h2><div class="mw-h3section"><h3><span class="mw-headline" id="By_plane">By plane</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=4" title="Edit section's source code: By plane"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></h3><style data-mw-deduplicate="TemplateStyles:r4851880">.mw-parser-output .pp_infobox{color:#333;background-color:#effafa;font-size:90%;border:1px solid #ccc;padding-left:1em;padding-right:1em;text-align:left;width:100%}html.skin-theme-clientpref-night .mw-parser-output .pp_infobox td{color:inherit!important;background-color:inherit!important}@media(prefers-color-scheme:dark){html.skin-theme-clientpref-os .mw-parser-output .pp_infobox td{color:inherit!important;background-color:inherit!important}}</style><table class="pp_infobox infobox" style="float:right; clear:right; margin-left: 1em; width:40%;" cellpadding="8" cellspacing="1">
<tbody><tr>
<td>
<p><strong>Oakland or Auckland?</strong>
</p><p>It's not just <i>Full House'</i>s Stephanie and Michelle Tanner that have ended up in <a href="/wiki/Auckland" title="Auckland">Auckland</a>, <a href="/wiki/New_Zealand" title="New Zealand">New Zealand</a> instead of Oakland, California. Several incidents have been reported of tourists destined for Oakland ending up on the wrong side of the Pacific, either due to ticketing agent errors, or because they misheard an Air New Zealand flight attendant saying their London to Los Angeles flight was continuing to "Oakland". It may pay to double check your airline tickets and the destination screens before you board your flight; otherwise, it will be an expensive flight home.
</p>
</td></tr></tbody></table><ul><li><bdi class="vcard"><span id="Q1165584"></span><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.71243</abbr><abbr class="longitude">-122.21317</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/0" data-zoom="17" data-lat="37.71243" data-lon="-122.21317" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">1</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="http://www.oaklandairport.com/" target="_blank"><span id="San_Francisco_Bay_Oakland_International_Airport" class="fn org listing-name" style="font-weight:bold;">San Francisco Bay Oakland International Airport</span></a><span id="Q1165584"></span> (<bdi class="nickname listing-alt" style="font-style: italic;"><b>OAK </b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup></bdi>) (<bdi class="listing-directions" style="font-style: italic;">Airport Rd off of Doolittle (SR-61); from Nimitz Freeway (I-880) the airport can be accessed from 98th Ave (Exit #36) or Hegenberger Rd (becomes Airport Rd) (Exit #35)</bdi>). <bdi class="note listing-content">It is served by many domestic and international carriers. Domestic non-stop air service is available from <a href="/wiki/Southern_California#By_plane" title="Southern California">Southern California</a>, Hawaii, most other cities on the West Coast, and a few flights to the East Coast. There are international flights from the Azores, El Salvador and Mexico. The main carriers that serve OAK are <a rel="nofollow noopener noreferrer" class="external text" href="https://www.spirit.com/en/flights-from-oakland" target="_blank">Spirit</a> and <a rel="nofollow noopener noreferrer" class="external text" href="https://www.southwest.com/origins/west/oakland" target="_blank">Southwest Airlines</a>:</bdi></bdi></li></ul><dl><dd><ul><li>Terminal 1 (Gates 1-17):Alaska, Allegiant, Avianca El Salvador, Azores, Contour (from <a href="/wiki/Crescent_City" title="Crescent City">Crescent City</a>); Delta, Hawaiian, Southwest, Spirit, Viva Aerobus, Volaris, Volaris El Salvador</li>
<li>Terminal 2 (Gates 20-32): Southwest.</li>
<li><a rel="nofollow noopener noreferrer" class="external text" href="https://www.jsx.com/destinations/oak" target="_blank">JSX</a> have their own separate terminal at 9351 Earhart Rd at the North Field (General Aviation/VIP Airport).<br></li></ul></dd></dl><p>There is private shuttle service ($10–25) to hotels in Oakland and San Francisco. The airport is also served by the "BART to OAK" people mover to the Oakland Coliseum BART Station, from where you can continue onward to central Oakland or San Francisco, or transfer to the similarly named Amtrak Capitol Corridor station. The people mover runs every 5 minutes during the day, and ticket pricing is integrated, e.g. $7.85 to central Oakland or $10.05 to central San Francisco. This replaces the earlier <i>AirBART</i> buses, which have now been retired. The ariport terminals are also served by <span class="vcard"> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.actransit.org/maps-schedules" target="_blank"><span id="AC_Transit" class="fn org listing-name" style="font-weight:bold;">AC Transit</span></a></span> routes #21, 73 and 805 while the nearby Coliseum BART Station is served by AC Transit #45, 46L, 73, 90, 98 and 805 buses.<span class="listing-sister-icons"> <span class="listing-sister" typeof="mw:File"><a href="https://www.wikidata.org/wiki/Q1165584" title="San Francisco Bay Oakland International Airport (Q1165584) on Wikidata" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="San Francisco Bay Oakland International Airport (Q1165584) on Wikidata" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/16px-Wikidata-logo.svg.png" decoding="async" width="16" height="9" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/24px-Wikidata-logo.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/32px-Wikidata-logo.svg.png 2x" data-file-width="1050" data-file-height="590"></a></span> <span class="listing-sister" typeof="mw:File"><a href="https://en.wikipedia.org/wiki/San_Francisco_Bay_Oakland_International_Airport" title="San Francisco Bay Oakland International Airport on Wikipedia" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="San Francisco Bay Oakland International Airport on Wikipedia" src="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/16px-Antu_wikipedia.svg.png" decoding="async" width="16" height="16" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/24px-Antu_wikipedia.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/32px-Antu_wikipedia.svg.png 2x" data-file-width="512" data-file-height="512"></a></span></span><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Apr 2020</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span>
</p><p>Other air travel options include the <b><a href="/wiki/San_Francisco_International_Airport" title="San Francisco International Airport">San Francisco</a></b> (<b><a href="/wiki/San_Francisco_International_Airport#By_plane" title="San Francisco International Airport">SFO</a></b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup>) and <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.flysanjose.com/" target="_blank">San Jose</a></b> (<b><a href="/wiki/San_Jose_(California)#By_plane" title="San Jose (California)">SJC</a></b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup>) International Airports which are connected by <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov" target="_blank">BART</a></b> and <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.caltrain.com" target="_blank">CalTrain</a></b>  if transferring by public transportation:
</p><dl><dd><ul><li><a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/cols" target="_blank">Coliseum Station</a> to <a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/sfia" target="_blank">Balboa Park Station</a> on the 'Blue' or 'Green' Line trains going towards Daly City. Transfer from the 'Blue' or 'Green' Line trains in Balboa Park Station to the 'Red' or 'Yellow' Line trains going towards SFO Airport/Millbrae Transit Center and get off at the '<a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/sfia" target="_blank">SFO Airport Station</a>' at the International Terminal</li>
<li>Downtown San Francisco is accessed through Embacardero, Montgomery St, Powell St, UN/Civic Plaza or Van Ness Stations. For going to downtown Oakland, take the northbound Orange Line train, going towards Richmond, and get off at either 12th St, 19th St, or MacArthur Stations.</li>
<li>For going towards San Jose Mineta International Airport stay on the 'Red' or 'Yellow' Line trains from SFO to the end of the line in Millbrae and transfer to the southbound <a rel="nofollow noopener noreferrer" class="external text" href="https://www.caltrain.com/stations-zones" target="_blank">Caltrain</a> (going towards San Jose or Gilroy) to the Santa Clara Caltrain Station. Transfer to <a rel="nofollow noopener noreferrer" class="external text" href="https://www.vta.org/go/routes/60" target="_blank">VTA #60</a> bus going towards Milpitas BART from the Santa Clara Caltrain Station, which goes by the airport terminals.</li>
<li>One can also take the southbound 'Green' or 'Orange' Line trains from the (Oakland) Coliseum Station, going towards Berryessa/North San Jose, and get off at the <a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/mlpt" target="_blank">Milpitas Station</a>. Transfer to the VTA #60 bus going towards 'Winchester Station via SJC Airport' from Milpitas to get to SJC airport.</li>
<li>Take <b><a rel="nofollow noopener noreferrer" class="external text" href="https://groometransportation.com/sonoma-county/sfo-oak/" target="_blank">Groome Transportation</a></b> bus or van from Oakland to Marin and Sonoma Counties up north and from San Jose (SJC) for going to Monterey Bay in the south.</li></ul></dd></dl><p>For private pilots, <b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.oaklandairport.com/general-aviation/" target="_blank">Oakland General Aviation Airport</a></b> (<b>OAK </b><sup><small><a href="/wiki/IATA" class="mw-redirect" title="IATA">&nbsp;IATA</a></small></sup>) has a separate General Aviation area "North Field", essentially the equivalent of another airport to the north of the commercial facilities, with separate tower, taxiways, and radio frequencies. Its long runway is frequently used for jet travel, and Oakland makes a far better GA destination than SFO's complex, heavily trafficked field.
</p></div><div class="mw-h3section"><h3><span class="mw-headline" id="By_train">By train</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=5" title="Edit section's source code: By train"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></h3><dl><dd><i>See also: <a href="/wiki/Rail_travel_in_the_United_States" title="Rail travel in the United States">Rail travel in the United States</a></i></dd></dl><ul><li><bdi class="vcard"><span id="Q3095811"></span><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.7938</abbr><abbr class="longitude">-122.2715</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/1" data-zoom="17" data-lat="37.7938" data-lon="-122.2715" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">2</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/stations/okj" target="_blank"><span id="Jack_London_Square_station" class="fn org listing-name" style="font-weight:bold;">Jack London Square station</span></a><span id="Q3095811"></span>, <bdi class="adr listing-address street-address">245 Second Street</bdi>. <bdi class="note listing-content">It's always a good idea to get to your train at least 30 minutes early, to allow for lines, security and so forth.</bdi><span class="listing-sister-icons"> <span class="listing-sister" typeof="mw:File"><a href="https://www.wikidata.org/wiki/Q3095811" title="Oakland–Jack London Square station (Q3095811) on Wikidata" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Oakland–Jack London Square station (Q3095811) on Wikidata" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/16px-Wikidata-logo.svg.png" decoding="async" width="16" height="9" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/24px-Wikidata-logo.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/32px-Wikidata-logo.svg.png 2x" data-file-width="1050" data-file-height="590"></a></span> <span class="listing-sister" typeof="mw:File"><a href="https://en.wikipedia.org/wiki/Oakland%E2%80%93Jack_London_Square_station" title="Oakland–Jack London Square station on Wikipedia" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Oakland–Jack London Square station on Wikipedia" src="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/16px-Antu_wikipedia.svg.png" decoding="async" width="16" height="16" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/24px-Antu_wikipedia.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/32px-Antu_wikipedia.svg.png 2x" data-file-width="512" data-file-height="512"></a></span></span><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Oct 2023</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi>
<ul><li><bdi class="vcard"><span id="Q23239"></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/" target="_blank"><span id="Amtrak" class="fn org listing-name" style="font-weight:bold;">Amtrak</span></a><span id="Q23239"></span>, <abbr title="phone" style="text-decoration:none">☏</abbr> <bdi class="tel listing-phone"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1215-856-7924" target="_blank">+1 215-856-7924</a></span></bdi>, toll-free: <bdi class="tel listing-tollfree"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1-800-872-7245" target="_blank">+1-800-872-7245</a></span></bdi>. <bdi class="note listing-content">Operates train service around the <a href="/wiki/United_States_of_America" title="United States of America">United States of America</a>.</bdi><span class="listing-sister-icons"> <span class="listing-sister" typeof="mw:File"><a href="https://www.wikidata.org/wiki/Q23239" title="Amtrak (Q23239) on Wikidata" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Amtrak (Q23239) on Wikidata" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/16px-Wikidata-logo.svg.png" decoding="async" width="16" height="9" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/24px-Wikidata-logo.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Wikidata-logo.svg/32px-Wikidata-logo.svg.png 2x" data-file-width="1050" data-file-height="590"></a></span> <span class="listing-sister" typeof="mw:File"><a href="https://en.wikipedia.org/wiki/Amtrak" title="Amtrak on Wikipedia" rel="mw:ExtLink noopener noreferrer" target="_blank"><img alt="Amtrak on Wikipedia" src="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/16px-Antu_wikipedia.svg.png" decoding="async" width="16" height="16" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/24px-Antu_wikipedia.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Antu_wikipedia.svg/32px-Antu_wikipedia.svg.png 2x" data-file-width="512" data-file-height="512"></a></span></span><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Mar 2022</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi> Routes stopping in Oakland:
<ul><li><b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/coast-starlight-train" target="_blank">Coast Starlight</a></b> operates daily between <a href="/wiki/Seattle" title="Seattle">Seattle</a> and <a href="/wiki/Los_Angeles" title="Los Angeles">Los Angeles</a>. Stops include <a href="/wiki/Tacoma" title="Tacoma">Tacoma</a>, <a href="/wiki/Lacey" title="Lacey">Lacey</a>, <a href="/wiki/Centralia_(Washington)" title="Centralia (Washington)">Centralia</a>, <a href="/wiki/Kelso_(Washington)" title="Kelso (Washington)">Kelso</a>, <a href="/wiki/Vancouver_(Washington)" title="Vancouver (Washington)">Vancouver, WA</a>, <a href="/wiki/Portland_(Oregon)" title="Portland (Oregon)">Portland,</a> <a href="/wiki/Salem_(Oregon)" title="Salem (Oregon)">Salem</a>, <a href="/wiki/Albany_(Oregon)" title="Albany (Oregon)">Albany</a>, <a href="/wiki/Eugene" title="Eugene">Eugene</a>, <a href="/wiki/Klamath_Falls" title="Klamath Falls">Klamath Falls</a>, <a href="/wiki/Dunsmuir" title="Dunsmuir">Dunsmuir</a>, <a href="/wiki/Redding" title="Redding">Redding</a>, <a href="/wiki/Chico_(California)" title="Chico (California)">Chico</a>, <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a>, <a href="/wiki/Davis_(California)" title="Davis (California)">Davis</a>, <a href="/wiki/Martinez_(California)" title="Martinez (California)">Martinez</a>, San Francisco (<a href="/wiki/Emeryville" title="Emeryville">Emeryville</a>), Oakland, <a href="/wiki/San_Jose_(California)" title="San Jose (California)">San Jose</a>, <a href="/wiki/Salinas" title="Salinas">Salinas</a>, <a href="/wiki/Paso_Robles" title="Paso Robles">Paso Robles</a>, <a href="/wiki/San_Luis_Obispo" title="San Luis Obispo">San Luis Obispo</a>, <a href="/wiki/Santa_Barbara" title="Santa Barbara">Santa Barbara</a>, <a href="/wiki/Oxnard" title="Oxnard">Oxnard</a>, <a href="/wiki/Simi_Valley" title="Simi Valley">Simi Valley</a>, <a href="/wiki/Van_Nuys" title="Van Nuys">Van Nuys</a>, and <a href="/wiki/Burbank" title="Burbank">Burbank</a>.</li>
<li><b><a rel="nofollow noopener noreferrer" class="external text" href="http://capitolcorridor.org/" target="_blank">Capitol Corridor</a></b> <a href="/wiki/San_Jose_(California)" title="San Jose (California)">San Jose</a> to <a href="/wiki/Auburn_(California)" title="Auburn (California)">Auburn</a> via <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a>). The route also includes a stop at the Oakland Coliseum/Airport Amtrak station. adjacent to the Oakland Coliseum BART station. The Oakland Coliseum/Airport Amtrak station has no station agents. Passengers may board the train and buy the tickets from the conductor at no surcharge.</li>
<li><b><a rel="nofollow noopener noreferrer" class="external text" href="https://www.amtrak.com/routes/san-joaquins-train.html" target="_blank">San Joaquins</a></b> (Oakland to <a href="/wiki/Bakersfield" title="Bakersfield">Bakersfield, California</a>)<figure class="mw-default-size" typeof="mw:File/Thumb"><a href="/wiki/File:Jack_London_Square_station_panorama,_October_2018.jpg" class="mw-file-description"><img src="//upload.wikimedia.org/wikipedia/commons/thumb/9/95/Jack_London_Square_station_panorama%2C_October_2018.jpg/220px-Jack_London_Square_station_panorama%2C_October_2018.jpg" decoding="async" width="220" height="95" class="mw-file-element" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/95/Jack_London_Square_station_panorama%2C_October_2018.jpg/330px-Jack_London_Square_station_panorama%2C_October_2018.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/95/Jack_London_Square_station_panorama%2C_October_2018.jpg/440px-Jack_London_Square_station_panorama%2C_October_2018.jpg 2x" data-file-width="5281" data-file-height="2284"></a><figcaption>Jack London Square station</figcaption></figure></li></ul></li></ul></li></ul><ul><li>Adjacent to the northwest of Oakland in <a href="/wiki/Emeryville#By_train" title="Emeryville">Emeryville</a>, is Amtrak's area hub station with more train route options.</li>
<li>Connections to the <b><a rel="nofollow noopener noreferrer" class="external text" href="http://www.amtrak.com/pacific-surfliner-train" target="_blank">Pacific Surfliner</a></b> are in San Luis Obispo and Santa Barbara, are available with <b>Amtrak Thruway Motorcoaches</b> (see By bus below).</li></ul></div><div class="mw-h3section"><h3><span class="mw-headline" id="By_car">By car</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=6" title="Edit section's source code: By car"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></h3><p>From San Francisco, Interstate 80 east leads over the beautiful <b>Bay Bridge</b> to I-580, I-880, and I-980, which go to east, west, and downtown Oakland respectively.
</p><p>From <a href="/wiki/Marin_County" title="Marin County">Marin</a>, <a href="/wiki/Sonoma_County" title="Sonoma County">Sonoma</a>, and other counties along the northern coast of California, take US-101 to I-580 and cross the Richmond Bridge. I-580 leads directly into Oakland.
</p><p>From <a href="/wiki/Monterey_(California)" title="Monterey (California)">Monterey</a>, <a href="/wiki/Salinas" title="Salinas">Salinas</a>, and the <a href="/wiki/Central_Coast_(California)" title="Central Coast (California)">Central Coast</a>, follow US-101 to San Jose and connect to I-880, which leads to Oakland.
</p><p>From <a href="/wiki/Tracy" title="Tracy">Tracy</a>, <a href="/wiki/Modesto" title="Modesto">Modesto</a>, and <a href="/wiki/San_Joaquin_Valley" title="San Joaquin Valley">San Joaquin Valley</a>'s southern portion (<a href="/wiki/Southern_California" title="Southern California">Southern California</a>, too), take the scenic I-580 over Altamont Pass.
</p><p>From <a href="/wiki/Stockton_(California)" title="Stockton (California)">Stockton</a>, either follow the Altamont Pass route or take California Route 4 through Contra Costa County to Route 242, then to Route I-680, which connects to Route 24.
</p><p>From the <a href="/wiki/Outer_East_Bay" title="Outer East Bay">outer East Bay</a>, Route 24 leads to north Oakland through the <b>Caldecott Tunnel</b>.
</p><p>From the northern <a href="/wiki/East_Bay_(Bay_Area)" class="mw-redirect" title="East Bay (Bay Area)">East Bay</a>, <a href="/wiki/Vallejo" title="Vallejo">Vallejo</a>, <a href="/wiki/Fairfield_(California)" title="Fairfield (California)">Fairfield</a>, and the greater <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a>, I-80 west leads directly to Oakland.
</p><p>Alternatively, you can connect to Highway 123 and <b>San Pablo Avenue</b> in <a href="/wiki/Richmond_(California)" title="Richmond (California)">Richmond</a>, and follow it to Oakland, if there is trouble on the parallel I-80. It's city streets, so will likely take extra time, and it will mean driving into and through everything between Richmond and West Oakland, including both <a href="/wiki/El_Cerrito" title="El Cerrito">El Cerrito</a> and <a href="/wiki/Berkeley" title="Berkeley">Berkeley</a>.
</p><p>Most northern entries to Oakland go through the heinous <b>MacArthur Maze</b>, a spaghetti-like mashup of four freeways trying to merge and pass each other. It's got terrible traffic during commute times (7AM-10AM, 4PM-8PM), so you might want to avoid driving on the freeways at these times.
</p></div><div class="mw-h3section"><h3><span class="mw-headline" id="By_bus">By bus</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=7" title="Edit section's source code: By bus"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></h3><p>The <span class="vcard"><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.80487</abbr><abbr class="longitude">-122.2952</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/2" data-zoom="17" data-lat="37.80487" data-lon="-122.2952" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">3</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.bart.gov/stations/woak" target="_blank"><span id="West_Oakland_BART_Station" class="fn org listing-name" style="font-weight:bold;">West Oakland BART Station</span></a></span> is also the bus stop location for the following intercity bus lines in Oakland:
</p><ul><li><bdi class="vcard"> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.flixbus.com/bus/oakland-berkeley-east-bay-ca" target="_blank"><span id="Flixbus" class="fn org listing-name" style="font-weight:bold;">Flixbus</span></a>, <bdi class="adr listing-address street-address">1431 7th St</bdi> (<bdi class="listing-directions" style="font-style: italic;">Near W. Oakland BART Station. Bus will board on 7th Street, in front of the public rental bike racks, located at the curbside with the sign, “No Stop. Bus Only."</bdi>), <abbr title="phone" style="text-decoration:none">☏</abbr> <bdi class="tel listing-phone"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1855626-8585" target="_blank">+1 855 626-8585</a></span></bdi>. <bdi class="note listing-hours">Daily 5:30AM-1:30AM</bdi>. <bdi class="note listing-content">They operate from <a href="/wiki/San_Francisco" title="San Francisco">San Francisco</a> to <a href="/wiki/Reno" title="Reno">Reno</a>, <a href="/wiki/Los_Angeles" title="Los Angeles">Los Angeles</a>, <a href="/wiki/Fresno" title="Fresno">Fresno</a>, <a href="/wiki/Bakersfield" title="Bakersfield">Bakersfield</a>, <a href="/wiki/Sacramento" title="Sacramento">Sacramento</a> and <a href="/wiki/San_Jose_(California)" title="San Jose (California)">San Jose</a>. They also have additional stops at the Crescent Lawn at the UC Berkeley campus, El Cerrito del Norte BART, Hayward BART and Richmond BART. Check tickets and schedules as to where your bus pick up at.</bdi><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Oct 2022</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi></li>
<li><bdi class="vcard"><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.80524</abbr><abbr class="longitude">-122.29481</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/3" data-zoom="17" data-lat="37.80524" data-lon="-122.29481" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">4</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.greyhound.com/en-us/bus-station-892540" target="_blank"><span id="Greyhound" class="fn org listing-name" style="font-weight:bold;">Greyhound</span></a>, <bdi class="adr listing-address street-address">(bus stop) West Oakland BART Station @ 1451 7th St</bdi>, <abbr title="phone" style="text-decoration:none">☏</abbr> <bdi class="tel listing-phone"><span class="plainlinks nourlexpansion"><a rel="nofollow noopener noreferrer" class="external text" href="tel:+1510832-4730" target="_blank">+1 510 832-4730</a></span></bdi>. <bdi class="note listing-content">Bus to Sacramento, Arcata, Los Angeles, San Joaquin Valley, etc.</bdi><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Oct 2022</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi></li>
<li><bdi class="vcard"><span class="noprint listing-coordinates" style="display:none"><span class="geo"><abbr class="latitude">37.80501</abbr><abbr class="longitude">-122.2942</abbr></span></span><span title="See this element on the map"><a class="mw-kartographer-maplink mw-kartographer-autostyled mw-kartographer-link" data-mw-kartographer="maplink" data-style="osm-intl" href="#/maplink/4" data-zoom="17" data-lat="37.80501" data-lon="-122.2942" style="background: #A52A2A;" data-overlays="[&quot;mask&quot;,&quot;around&quot;,&quot;buy&quot;,&quot;city&quot;,&quot;do&quot;,&quot;drink&quot;,&quot;eat&quot;,&quot;go&quot;,&quot;listing&quot;,&quot;other&quot;,&quot;see&quot;,&quot;sleep&quot;,&quot;vicinity&quot;,&quot;view&quot;]">5</a></span> <a rel="nofollow noopener noreferrer" class="external text" href="https://us.megabus.com/" target="_blank"><span id="Megabus" class="fn org listing-name" style="font-weight:bold;">Megabus</span></a>, <bdi class="adr listing-address street-address">(bus stop) West Oakland BART Station @ 1451 7th St</bdi> (<bdi class="listing-directions" style="font-style: italic;">SAme location as Greyhound and Flix bus</bdi>). <bdi class="note listing-content">Goes over to Sacramento on one route and down to Los Angeles via Fresno, Bakersfield, Burbank on another.</bdi><span class="listing-metadata"> (<span class="listing-metadata-items"><bdi class="listing-lastedit">updated Sep 2023</bdi>&nbsp;|&nbsp;<span class="vcard-edit-button noprint"><a href="javascript:" class="listingeditor-edit">edit</a></span></span>)</span></bdi></li>
<li><b>Amtrak Thruway Motorcoaches</b> connects Amtrak trains in Emeryville and Oakland Jack London Stations with downtown San Francisco, Santa Barbara and San Luis Obispo by bus.</li></ul><p>This BART station is also the bus transit center for <span class="vcard"> <a rel="nofollow noopener noreferrer" class="external text" href="https://www.actransit.org/maps-schedules" target="_blank"><span id="ACTransit" class="fn org listing-name" style="font-weight:bold;">ACTransit</span></a></span> routes #29, 36, 62 and 800. The 800 only stops at the corner of 7th and Mandela Pkwy.
</p></div><div class="mw-h3section"><h3><span class="mw-headline" id="By_ferry">By ferry</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Oakland&amp;action=edit&amp;section=8" title="Edit section's source code: By ferry"><span>edit source</span></a><span class="mw-editsection-bracket">]</span><span class="mw-editsection-bracket">[</span><a href="javascript:" class="listingeditor-add">add listing</a><span class="mw-editsection-bracket">]</span></span></h3><p>The <b><a rel="nofollow noopener noreferrer" class="external text" href="http://www.sanfranciscobayferry.com" target="_blank">San Francisco Bay Ferry</a></b> has departures from both Pier 41 and the Ferry Building in San Francisco. Its Oakland terminal is at the foot of Clay St. in Jack London Square, a block from the AC Transit stop and easy walking distance to the Amtrak Station.
</p></div></div>`;

const sectionToTemplateType = {
    Get_in: 'go'
};
describe( 'findListingTypeForSection', () => {
    it( 'works for old HTML', () => {
        $( oldHeading ).appendTo( document.body );
        const type = findListingTypeForSection(
            $( '.listingeditor-add' ),
            sectionToTemplateType,
            'listing'
        );
        expect( type ).toBe( 'go' );
    } );

    it( 'works for new HTML', () => {
        $( newHeading ).appendTo( document.body );
        const type = findListingTypeForSection(
            $( '.listingeditor-add' ),
            sectionToTemplateType,
            'listing'
        );
        expect( type ).toBe( 'go' );
    } );
} );
